import "./App.css";
import React, { Component } from "react";

import axios from "axios";

class GamesList extends Component {
  constructor() {
    super();
    this.state = {
      games: []
    };
  }

  componentDidMount() {
    axios.get(`http://127.0.0.1:8000/socapi`).then(response => {
      this.setState({
        games: response.data
      });
    });
  }

  render() {
    const { games } = this.state;
    return (
      <ul>
        {games.map(game => (
          <li>{game.country}</li>
        ))}
      </ul>
    );
  }
}
export default GamesList;
